module.exports = async function (callback) {
  let provider = new Web3.providers.HttpProvider(process.env.ETH_PROVIDER_URI)
  let web3 = new Web3(provider)

  web3.eth.defaultAccount = ''

  console.log('Loading Contract')
  let crowdSaleDef = require('../build/contracts/SwarmCrowdsale.json')
  let crowdsaleABI = crowdSaleDef.abi
  let crowdSaleContract = web3.eth.contract(crowdsaleABI)
  let crowdsaleInstance = crowdSaleContract.at('')

  // To be run for distribution
  console.log('Loading Allocations')
  for (let i = 0; i < phase1Mints.length; i++) {
    console.log(web3.isAddress(phase1Mints[i].address))
    console.log('' + i + ' Minting ' + phase1Mints[i].address + ' amt: ' + phase1Mints[i].amt)
    crowdsaleInstance.presaleMint(phase1Mints[i].address, phase1Mints[i].amt, { gasPrice: 100000000000, gas: 200000 })
  }
}
